import React from "react"
import styled from 'styled-components'

import BufferStyle from "./BufferStyle"
import Triangle from "../SVG/Triangle/Triangle"


// Create a Title component that'll render an <h1> tag with some styles
const HeaderStyle = styled.div`
  //box-shadow: rgba(0, 0, 0, 0.2) 0px 3px 5px -1px, rgba(0, 0, 0, 0.14) 0px 6px 10px 0px, rgba(0, 0, 0, 0.12) 0px 1px 14px 0px;
  //display: flex;
  //position: absolute;
  width: 100%;
  word-wrap: break-word;
  border: 1px solid #808080;
`;

const LeftContentStyle = styled.div`
  width: 150px;
`;

const CurrentConentStyle = styled.div`
  display: flex;
`;

const CurrentConent_IndexStyle = styled.div`
  background: silver;
  color: white;
  width: 50%;
  height: 50%;
  border: 1px solid #808080;
  align-self: center;
`;

class Buffer extends React.PureComponent{
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          position: {
            x: this.props.x !== undefined ? this.props.x : 0,
            y: this.props.y !== undefined ? this.props.y : 0
          },

          list: this.props.list !== undefined ? this.props.list : [],
          currentItem: this.props.currentItem !== undefined ? this.props.currentItem : "",

        };
      }

      render() {
        const {position} = this.state
        return (
         <BufferStyle position={position}>
              <LeftContentStyle>
                   <HeaderStyle>
                        <p>Текущий</p>
                    </HeaderStyle>
                    <CurrentConentStyle>
                        <CurrentConent_IndexStyle>
                            <p>1</p>
                       </CurrentConent_IndexStyle>
                       <div>
                            <div>
                                <p>Заказ</p>
                                <p>25шт</p>
                            </div>
                       </div>
                    </CurrentConentStyle> 
                    <HeaderStyle>
                        <p>Выбран</p>
                    </HeaderStyle> 
                   <div>ЛистИтем</div>  
              </LeftContentStyle>
              <Triangle   left={0} top={0} width={100} height={100} min={50} max={100} value={0}/>
         </BufferStyle>
        )
      }
}


export default Buffer;
